/**
 * Blockera dependencies
 */
import { createCssDeclarations } from '../../../../style-engine';

export function MaskGenerator(id, props) {
	const { attributes } = props;

	if (!Object.keys(attributes?.blockeraMask)?.length) {
		return '';
	}

	const item = attributes?.blockeraMask[0];
	const properties = {};

	if (!item.isVisible) {
		return null;
	}

	const size =
		item.size === 'custom'
			? item['size-width'] || 'auto' + ' ' + item['size-height'] || 'auto'
			: item.size;

	properties.mask = `${getSelectedShape(item.shape.id)} ${
		item.position.left
	} ${item.position.top}/${size} ${item.repeat}`;

	if (item['horizontally-flip'] || item['vertically-flip']) {
		properties.transform = `${
			item['horizontally-flip'] ? 'scaleX(-1)' : ''
		} ${item['vertically-flip'] ? 'scaleY(-1)' : ''}`;
	}

	return createCssDeclarations({
		properties,
	});
}

